window.addEventListener('load', 
  function() { 
    if (!enable) return;
    let rows = document.getElementsByTagName("tr");
    for (let i=0; i<rows.length; i++) {
        let item = rows[i].getElementsByTagName("td")[1];
        item.removeChild(item.lastChild);
        
        for (let j=0; j<18; j++) {
            let a = document.createElement("span");
            a.appendChild(document.createTextNode("A"));
            a.setAttribute("title", "Accepted");
            a.setAttribute("class", "case-AC");
            
            let c = document.createElement("span");
            c.appendChild(document.createTextNode("C"));
            c.setAttribute("title", "Accepted");
            c.setAttribute("class", "case-AC");
            
            item.appendChild(a);
            item.appendChild(c);
        }
    }
    let index = 0;
    const interval = setInterval(() => {
        if (index >= frames.length) return;
        
        let frame = frames[index];
        for (let i=0; i<rows.length; i++) {
            let item = rows[i].getElementsByTagName("td")[1];
            let pixels = item.getElementsByTagName("span");
            
            for (let j=0; j<36; j++) {      
                if (frame[i][j] === 1) {
                    pixels[j].textContent = j % 2 === 0 ? "A" : "C";
                    pixels[j].setAttribute("title", "Accepted");
                    pixels[j].setAttribute("class", "case-AC");  
                }
                else {
                    pixels[j].textContent = j % 2 === 0 ? "W" : "A";
                    pixels[j].setAttribute("title", "Wrong Answer");
                    pixels[j].setAttribute("class", "case-WA");  
                }
            }
        }
        index++;
        
    }, 500);
  }, false);